// Random Point in Overlapping Rectangles
// https://leetcode.com/explore/challenge/card/august-leetcoding-challenge/552/week-4-august-22nd-august-28th/3433/

using namespace std;

void print(vector<int>& v) {
    for(auto i : v) {
        cout << i << " ";
    }
    cout << endl;
}

class Solution {
public:
    Solution(vector<vector<int>>& rects) : rechtecke(&rects) {
        for(auto r : rects){
            int b = r[2] - r[0] + 1;
            int h = r[3] - r[1] + 1;
            int flaeche = flaechen.size() ? flaechen.back() + b * h : b * h; 
            flaechen.push_back(flaeche);
        }
    }

    vector<int> pick() {
        // rand() will deliver the same squence on subsequent calls to it

        // random selection of rectangle
        // probablity of picking up a random rectangle must be proportional to the number if points
        // last value of flaechen is = to sum of flaechen
        int fidx = rand() % flaechen.back();
        auto it = upper_bound(flaechen.begin(), flaechen.end(), fidx);
        int idx = it - flaechen.begin();

        // random calculation of offset
        int offsetx = rand() % (abs(rechtecke->at(idx).at(0) - rechtecke->at(idx).at(2) ) + 1);
        int offsety = rand() % (abs(rechtecke->at(idx).at(1) - rechtecke->at(idx).at(3) ) + 1);
   
        return {rechtecke->at(idx).at(0) + offsetx, rechtecke->at(idx).at(1) + offsety};
   }
private:
    vector<int> flaechen;
    vector<vector<int>>* rechtecke;
};


